import { lazy } from 'react'
// import {
//   HomeOutlined,
//   PictureOutlined,
//   MenuOutlined,
//   PicLeftOutlined,
//   SwapLeftOutlined,
//   BorderTopOutlined,
//   ClockCircleOutlined,
//   UserOutlined,
//   AppstoreOutlined
// } from '@ant-design/icons'
const menus = [
  { 
    path: '/',
    key: '/',
    redirect: '/investment',
    meta: { // 该路由不出现在左侧菜单栏
      hidden: true
    }
  },
  {
    path: '/investment',
    key: '0-0',
    title: '投资',
    // icon: <HomeOutlined />
    component: lazy(() => import('./../views/Investment'))
  },
  {
    path: '/investment',
    key: '0-1',
    title: '自动化投资',
    // icon: <HomeOutlined />,
    component: lazy(() => import('./../views/AutomaticInvestment'))
  },
]

export default  menus
